import React from 'react'

class Doodler extends React.Component{
  constructor(){
    super()
    this.state={
      'vel':0,
      'acc':1,
      'x':0,
      'y':0,
    }
    this.move()
  }
  move(){
    setInterval(()=>{
      console.log('elo')
    }, 2000)
  }
  render(){
    this.setState({'x':this.props.x,'y':this.props.y})
    return(
      <div className='doodler' style={{top:`${this.props.y}px`,left:`${this.props.x}px`}}>
      </div>

    )
  }


}

export default Doodler
